import React from "react";

const FilterBox = () => {
  return (
    <div className="container my-4">
      <h5 className="mb-3">종목별 보기</h5>
      <div className="d-flex gap-2 flex-wrap">
        <button className="btn btn-outline-primary">전체</button>
        <button className="btn btn-outline-primary">축구</button>
        <button className="btn btn-outline-primary">보드게임</button>
        <button className="btn btn-outline-primary">야구</button>
      </div>
    </div>
  );
};

export default FilterBox;
